#[derive(Debug, Serialize, Deserialize)]
pub struct NormalInput {
    pub stack_inputs: StackInputs,
    pub advice_provider: MemAdviceProvider,
}

#[derive(Debug, Serialize, Deserialize, Clone)]
pub struct VMResult {
    pub outputs: StackOutputsString,
    pub starkproof: ExecutionProof,
}

#[derive(Debug, Serialize, Deserialize, Clone)]
pub struct StackOutputsString {
    /// The elements on the stack at the end of execution.
    pub stack: Vec<String>,
    /// The overflow table row addresses required to reconstruct the final state of the table.
    pub overflow_addrs: Vec<String>,
}

pub fn execute_zk_program(program_code: String, stack_init: String, advice_tape: String) -> String {
    let options = ProofOptions::with_96_bit_security();

    let assembler = Assembler::default().with_library(&stdlib::StdLibrary::default()).unwrap();

    let program = assembler.compile(&program_code).unwrap();

    let inputs: NormalInput = convert_stackinputs(stack_init, advice_tape);

    let res = prove(&program, inputs.stack_inputs, inputs.advice_provider, options);

    assert!(res.is_ok(), "The proof generation fails: {:?}", res);

    let (outputs, proof) = res.unwrap();

    let stack_string: Vec<String> = outputs.stack.iter().map(|(v)| (v.to_string())).collect();

    let overflow_addrs_string: Vec<String> =
        outputs.overflow_addrs.iter().map(|(v)| (v.to_string())).collect();

    let outputs_string = StackOutputsString {
        stack: stack_string,
        overflow_addrs: overflow_addrs_string,
    };

    let result = VMResult {
        outputs: outputs_string,
        starkproof: proof,
    };

    let final_result: String = serde_json::to_string(&result).unwrap();
    return final_result;
}

pub fn generate_program_hash(program_in_assembly: String) -> String {
    let assembler = Assembler::default().with_library(&stdlib::StdLibrary::default()).unwrap();
    let program = assembler.compile(&program_in_assembly).unwrap();
    use vm_core::utils::Serializable;
    let program_hash = program.hash().to_bytes();
    let ph = hex::encode(program_hash);
    return ph;
}

pub fn convert_stackinputs(stack_init: String, advice_tape: String) -> NormalInput {
    let mut stack_inita = Vec::new();
    let mut advice_tapea = Vec::new();
    if stack_init.len() != 0 {
        let stack_init: Vec<&str> = stack_init.split(',').collect();
        stack_inita = stack_init
            .iter()
            .map(|stack_init| Felt::new(stack_init.parse::<u64>().unwrap()))
            .collect();
    };

    if advice_tape.len() != 0 {
        let advice_tape: Vec<&str> = advice_tape.split(',').collect();
        advice_tapea = advice_tape
            .iter()
            .map(|advice_tape| advice_tape.parse::<u64>().unwrap())
            .collect();
    };

    let stack_input: StackInputs = StackInputs::new(stack_inita);

    let advice_inputs = AdviceInputs::default().with_stack_values(advice_tapea).unwrap();

    let mem_advice_provider: MemAdviceProvider = MemAdviceProvider::from(advice_inputs);

    let inputs = NormalInput {
        stack_inputs: stack_input,
        advice_provider: mem_advice_provider,
    };

    return inputs;
}


/// Gets a greeting for the name.
fn greeting(program_hash: &String, stack_inputs: &String, output: &String) -> String {
    // return ["Hello, ", &name, "!"].concat();
    let origin = "a99b7127c66435a3ab551422d6746c8af0bbf97b1a981f1bd97fd270fdea92b4";
    let bytes_origin = hex::decode(origin);

    let bytes_param = hex::decode(program_hash);

    format!(
        "Program hash length: {}, Stack inputs length: {}, Output length: {}, origin_bytes is {:?}, parm_bytes is {:?} programHash.length is {}, stack input.length {}, output.length is {}",
        program_hash.len(),
        stack_inputs.len(),
        output.len(),
        bytes_origin,
        bytes_param,
        program_hash.len(),
        stack_inputs.len(),
        output.len()


    )
}

pub fn verify_zk_bool(
    program_hash: &String,
    stack_inputs: &String,
    zk_outputss: &String
) -> String {
    // let program_hash = "a99b7127c66435a3ab551422d6746c8af0bbf97b1a981f1bd97fd270fdea92b4"; 
    // let stack_inputs = "";

    let mut stack_inita = Vec::new();

    if stack_inputs.len() != 0 {
        let stack_init: Vec<&str> = stack_inputs.split(',').collect();
        stack_inita = stack_init
            .iter()
            .map(|stack_init| Felt::new(stack_init.parse::<u64>().unwrap()))
            .collect();
    };
    let stack_input: StackInputs = StackInputs::new(stack_inita);


    let bytes = hex::decode(program_hash).unwrap();

    assert_eq!(32, bytes.len());


    let mut reader = SliceReader::new(&bytes);

    let program_digest = Digest::read_from(&mut reader).unwrap();

    let kernel = Kernel::default();
    let program_info = ProgramInfo::new(program_digest, kernel);

    let zk_outputs: VMResult = serde_json::from_str(&zk_outputss).unwrap();

    let stack_origin = zk_outputs
        .outputs
        .stack
        .iter()
        .map(|init| init.parse::<u64>().unwrap())
        .collect();

    let overflow_addrs_origin = zk_outputs
        .outputs
        .overflow_addrs
        .iter()
        .map(|init| init.parse::<u64>().unwrap())
        .collect();

    let stack_outputs_origin = StackOutputs {
        stack: stack_origin,
        overflow_addrs: overflow_addrs_origin,
    };

    let verification_result =
        verify(program_info, stack_input, stack_outputs_origin, zk_outputs.starkproof);
    if(verification_result.is_ok()){
        return format!("OK")
    }else{
        return format!("Failed");
    }

}

#[cfg_attr(all(target_arch = "wasm32"), export_name = "greeting")]
#[no_mangle]
pub unsafe extern "C" fn _greeting(
    program_hash_ptr: u32,
    program_hash_len: u32,
    stack_inputs_ptr: u32,
    stack_inputs_len: u32,
    output_ptr: u32,
    output_len: u32,
) -> u64 {
    let program_hash = &ptr_to_string(program_hash_ptr, program_hash_len);
    let stack_inputs = &ptr_to_string(stack_inputs_ptr, stack_inputs_len);
    let output = &ptr_to_string(output_ptr, output_len);

    let g = greeting(program_hash, stack_inputs, output);
    let (ptr, len) = string_to_ptr(&g);
    // Note: This changes ownership of the pointer to the external caller. If
    // we didn't call forget, the caller would read back a corrupt value. Since
    // we call forget, the caller must deallocate externally to prevent leaks.
    std::mem::forget(g);
    return ((ptr as u64) << 32) | len as u64;
}


/// WebAssembly export that accepts a string (linear memory offset, byteCount)
/// and returns a pointer/size pair packed into a u64.
///
/// Note: The return value is leaked to the caller, so it must call
/// [`deallocate`] when finished.
/// Note: This uses a u64 instead of two result values for compatibility with
/// WebAssembly 1.0.
#[cfg_attr(all(target_arch = "wasm32"), export_name = "verify_zk_bool")]
#[no_mangle]
pub unsafe extern "C" fn _verify_zk_bool(
    program_hash_ptr: u32,
    program_hash_len: u32,
    stack_inputs_ptr: u32,
    stack_inputs_len: u32,
    output_ptr: u32,
    output_len: u32,
) -> u64 {
    let program_hash = &ptr_to_string(program_hash_ptr, program_hash_len);
    let stack_inputs = &ptr_to_string(stack_inputs_ptr, stack_inputs_len);
    let output = &ptr_to_string(output_ptr, output_len);

    // let g = String::from("Hi");
    // let g = verify_zk_bool( output);

    let g = verify_zk_bool(program_hash, stack_inputs, output);
    let (ptr, len) = string_to_ptr(&g);
    // Note: This changes ownership of the pointer to the external caller. If
    // we didn't call forget, the caller would read back a corrupt value. Since
    // we call forget, the caller must deallocate externally to prevent leaks.
    std::mem::forget(g);
    return ((ptr as u64) << 32) | len as u64;
}


/// Returns a string from WebAssembly compatible numeric types representing
/// its pointer and length.
unsafe fn ptr_to_string(ptr: u32, len: u32) -> String {
    let slice = slice::from_raw_parts_mut(ptr as *mut u8, len as usize);
    let utf8 = std::str::from_utf8_unchecked_mut(slice);
    return String::from(utf8);
}

/// Returns a pointer and size pair for the given string in a way compatible
/// with WebAssembly numeric types.
///
/// Note: This doesn't change the ownership of the String. To intentionally
/// leak it, use [`std::mem::forget`] on the input after calling this.
unsafe fn string_to_ptr(s: &String) -> (u32, u32) {
    return (s.as_ptr() as u32, s.len() as u32);
}

/// Set the global allocator to the WebAssembly optimized one.
#[global_allocator]
static ALLOC: wee_alloc::WeeAlloc = wee_alloc::WeeAlloc::INIT;

/// WebAssembly export that allocates a pointer (linear memory offset) that can
/// be used for a string.
///
/// This is an ownership transfer, which means the caller must call
/// [`deallocate`] when finished.
#[cfg_attr(all(target_arch = "wasm32"), export_name = "allocate")]
#[no_mangle]
pub extern "C" fn _allocate(size: u32) -> *mut u8 {
    allocate(size as usize)
}

/// Allocates size bytes and leaks the pointer where they start.
fn allocate(size: usize) -> *mut u8 {
    // Allocate the amount of bytes needed.
    let vec: Vec<MaybeUninit<u8>> = Vec::with_capacity(size);

    // into_raw leaks the memory to the caller.
    Box::into_raw(vec.into_boxed_slice()) as *mut u8
}

/// WebAssembly export that deallocates a pointer of the given size (linear
/// memory offset, byteCount) allocated by [`allocate`].
#[cfg_attr(all(target_arch = "wasm32"), export_name = "deallocate")]
#[no_mangle]
pub unsafe extern "C" fn _deallocate(ptr: u32, size: u32) {
    deallocate(ptr as *mut u8, size as usize);
}

/// Retakes the pointer which allows its memory to be freed.
unsafe fn deallocate(ptr: *mut u8, size: usize) {
    let _ = Vec::from_raw_parts(ptr, 0, size);
}

